Orange is a 15 year old boy who shares a wisecracking friendship with a perky young girl named Kiwi. When the new school term starts in spring, Orange finds himself instantly falling for the smart and attractive Apple. But when the bewitchingly beautiful Lemon shows up, Orange&rsquo;s heart starts to pull him in both directions at the same time. And as Kiwi worries about what&rsquo;s becoming of Orange, cracks begin to show in their friendship&hellip;

Note: In Full Colour

On June 22, 2006, Le Gardenie received third place in Japan's first International Manga Award.

When Philomena Peabody met her boss's son, he was suffering temporary snow blindness. &quot;You sound like somebody's mother;&quot; Penn Wilderman said, convinced by her no-nonsense attitude that she was &quot;a sweet little old lady.&quot;

Even after she'd moved into his luxurious mansion to help look after his son, Phil couldn't disillusion Penn about her age.

To help win a custody battle for his teenage son, Phil agreed to marry Penn. But she dreaded facing him once the bandages were off, and he could see his attractive twenty-seven-year-old wife....

&quot;Today's dinner is omurice!&quot;
&quot;Don't need it.&quot;
A story of the cohabitation between a skilled high school chef and a middle aged novelist. After his father's move abroad, Asaoka Mahiru began living with one of his father's acquaintances, the indifferent novelist Kitagawa Yoruko. Despite being close to other guys, she walks around without a bra and refuses to eat Mahiru's meals. His attempts at getting her to eat result in&hellip;?!

&quot;You don't have to do anything, but let me love you.&quot;

The 16 year old Yoshino Kaori marries the 20 year old Misono Tamaki, the &quot;Poisonous Earl&quot; and leader of the rumored &quot;Family of Death&quot; due to certain circumstances. At first, Kaori only uses the marriage, but over time, she answers to his feelings as she experiences a sweet and deep love with her first time as if she's drowning in pleasure... enjoy this heart-warming and stimulating Taisho era love story!




Pt/Br:
&ldquo;Os pais de Yoshino Kaori foram mortos e ela vive sozinha neste mundo. Ap&oacute;s o assassinato de seus pais, a jovem Kaori Yoshino (ela vive sozinha. Foi ent&atilde;o que Tamaki Mizono, conde e presidente da empresa que concorreu com seus pais aparece diante dela e propor um casamento por conveni&ecirc;ncia. Foi um casamento sem muito significado, mas pouco a pouco, conhecendo o verdadeiro jeito de ser de seu marido, Kaori sente uma atra&ccedil;&atilde;o irreprim&iacute;vel em rela&ccedil;&atilde;o a ele.&rdquo;

Tokita Eiji, the handsome Student Council President whom the entire student body admires, and Okamoto Oriya, who leads a very ordinary school life: the two don't have anything in common at all, but one day, Oriya suddenly gets romanced passionately by Eiji&hellip;!

&quot;Oriya, I think that we should get married soon.&quot;

What will Oriya do with Eiji's perverted love?!

A spy, a madman, a promise.
&ldquo;When the peach flowers in our garden bloom, I will return.&rdquo;
It was not a happy-ending story, but it was theirs.

[EN] In 2015, the &quot;Angels&quot; have returned, and Shinji Ikari, a fourteen year-old child of the new Earth, is forced by his father -- Gendo, commander of the secret organization NERV -- to pilot the monstrous biomechanical weapon called &quot;Evangelion&quot; to match the Angels' fearsome power...

     [FR] En l'an 2000, une gigantesque explosion se produit en Antarctique, provoquant un cataclysme qui d&eacute;vaste une grande partie de la plan&egrave;te. Quinze ans plus tard, l'Humanit&eacute; a surmont&eacute; cet &eacute;v&eacute;nement, appel&eacute; le Second Impact. Mais de myst&eacute;rieuses cr&eacute;atures nomm&eacute;es Anges font leur apparition, et tentent de d&eacute;truire Tokyo-3, la nouvelle capitale-forteresse du Japon construite apr&egrave;s le Second Impact.  Pour les combattre, l'organisation secr&egrave;te NERV a mis au point une arme ultime, &quot;l'Evangelion&quot;  g&eacute;ant anthropo&iuml;de pilot&eacute; comme une simple m&eacute;canique, mais en r&eacute;alit&eacute; cr&eacute;ature bien myst&eacute;rieuse. 
Shinji Ikari, jeune gar&ccedil;on de 14 ans, se rend &agrave; Tokyo-3 sur invitation de son p&egrave;re, qu'il n'a pas revu depuis 10 ans. Il est loin de se douter qu'il sera impliqu&eacute; dans un conflit qui pourrait bien signifier la fin de l'humanit&eacute; quoi qu'il arrive&hellip;

